import React from "react";
import periodicTables from "./periodicTables.png"
import weLoveMovies from "./weLoveMovies.png"

function Projects() {
  return (
    <div>
      <h2 id="projects">My Babies</h2>
      <div className="row">
        <div className="column2">
          <h4>PeriodicTables</h4>
          <img
            className="imageClass"
            src={periodicTables}
            style={{ marginBottom: "25px" }}
          />
          <p>A restaurant reservation system </p>
          <p>React, CSS, Express, Knex, PostgreSQL.</p>
        </div>
        <div className="column2">
          <h4>WeLoveMovies</h4>
          <img
            className="imageClass"
            src={weLoveMovies}
            style={{ marginBottom: "25px" }}
          />
          <p>Find Your Favorite Movie</p>
          <p>Node, Express, Knex, PostgreSQL, HTTP </p>
        </div>
      </div>
    </div>
  );
}

export default Projects;
